import React, { useState } from "react";
import "./RestaurantCard.scss";
const images_path = require(window.location.origin+"/assets/images/restaurants/Onzo.png");
  // "/assets/images/restaurants/Onzo.png");
// /assets/images/search-background.png

const RestaurantCard: React.FC<{ name: string; chef: string; src: string }> = (
  props
) => {
  console.log(window.location.origin+"/assets/images/restaurants/Onzo.png");
  return (
    <div className="card-frame">
      <img src={images_path}/>
      {props.name}<br/>
      {props.chef}<br/>
      {props.src} 
    </div>
  );
};

export default RestaurantCard;
